pragma solidity 0.5.1;

import "../Token/IERC20.sol";

/**
 * @title Account
 * @dev Implementation of the Account contract
 * estimate gas = 445016 / 2gwei 0.000890032 eth
 */

contract Account {

    address private sender;

    event DepositEvent(address _sender, uint256 _amount);

    constructor() public {
        sender = msg.sender;
    }

    function () external payable {
        emit DepositEvent(msg.sender, msg.value);
    }

    function executeCall(
        address _token,
        address _to,
        uint256 _value,
        bytes memory _data,
        uint256 _txGas
    ) public returns (bool success) {
        require(msg.sender == sender);
        if (_token == address(0x0)) {
            // solhint-disable-next-line no-inline-assembly
            assembly {
                success := call(_txGas, _to, _value, add(_data, 0x20), mload(_data), 0, 0)
            }
        } else {
            success = IERC20(_token).transfer(_to, _value);
        }
    }

    function executeCreate2(bytes memory _data, uint256 _salt) public returns (address deployed) {
        require(msg.sender == sender);
        bytes32 actualHash = keccak256(abi.encodePacked(_salt));
        // solhint-disable-next-line no-inline-assembly
        assembly {
            deployed := create2(0, add(_data, 0x20), mload(_data), actualHash)
        }
    }
}

